import React from "react";
import ProductCard from "../Products/ProductCard";
import styles from "../Products/Products.module.css";
import Navbar from "../Navbar/Navbar";
function MyProducts(props) {
	console.log(typeof props.account);
	return (
		<div>
			<Navbar
				loading={props.loading}
				account={props.account}
				ecommerce={props.ecommerce}
				setLoading={props.setLoading}
				productCount={props.productCount}
				toggleRefresh={props.toggleRefresh}
			/>
			<div>Products</div>
			<div className={`container-fluid ${styles.innerContainer}`}>
				<div className={`row justify-content-start`}>
					{props.products.map((product, index) => {
						return !product.purchased && product.owner == props.account ? (
							<ProductCard
								product={product}
								key={index}
								account={props.account}
								ecommerce={props.ecommerce}
								setLoading={props.setLoading}
								handleToastShowOpen={props.handleToastShowOpen}
								toggleRefresh={props.toggleRefresh}
								showBtn={false}
							/>
						) : (
							<></>
						);
					})}
				</div>
			</div>
			<div>Puchased Products</div>
			<div className={`container-fluid ${styles.innerContainer}`}>
				<div className={`row justify-content-start`}>
					{props.products.map((product, index) => {
						return product.purchased && product.owner === props.account ? (
							<ProductCard
								product={product}
								key={index}
								account={props.account}
								ecommerce={props.ecommerce}
								setLoading={props.setLoading}
								handleToastShowOpen={props.handleToastShowOpen}
								toggleRefresh={props.toggleRefresh}
								showBtn={false}
							/>
						) : (
							<></>
						);
					})}
				</div>
			</div>
		</div>
	);
}

export default MyProducts;
